import React from 'react'
import TextField from '@mui/material/TextField';
import '../App.css';
import Button from '@mui/material/Button';

export default function Edit({closeEditModal}) {
  return (
    <div className='modalBackground'>
    <div className='modalContainer'>
      <form>
        <h1> Edit data</h1>
        <TextField id="demo-helper-text-misaligned-no-helper" label="Title" name='title' sx={{ width: '41ch' }} />
        <br></br>
        <br></br>
        <TextField id="demo-helper-text-misaligned-no-helper" label="Description" name='body' sx={{ width: '41ch' }} />
        <div className='buttons'>
          <Button variant="contained" color="inherit" type="submit" >Save</Button>
          <Button variant="outlined"  color="inherit" onClick={() => closeAddModal(false)}>Cancel</Button>
        </div>
      </form>
    </div>
    </div>
  )
}
